import React from "react";
import HomeDetails from "./HomeDetails";
const Card = () => {
  return (
    <div>
      {HomeDetails.map((HomeDetail) => (
        <div className="card ">
          <img src={HomeDetail.image} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title text-center">{HomeDetail.item}</h5>
            <div className="row justify-content-around">
              <span className="card-text">{HomeDetail.amount}</span>
              <span className="">
                <button className="btn btn-primary ">Buynow</button>
              </span>
            </div>
          </div>
        </div>
      ))}{" "}
    </div>
  );
};

export default Card;
